import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
  formControl: {
    margin: theme.spacing(1), minWidth: 120, marginBottom: '30px', marginLeft: '20px',
  },
  container: {
    width: 500,
    height: 500,
  },
}));
